import React from 'react';
import { Nav } from 'react-bootstrap';
import styled from 'styled-components';
import  { NavLink} from 'react-router-dom';
import { Jumbotron_sm } from './components/Jumbotron_sm';
import { LinkContainer } from 'react-router-bootstrap';
import Professional_tab from './components/Professional_tab';
import Holder from 'holderjs'

const Styles = styled.div`
  .nav-link {
    color: #1A2349;
  }

  a.nav-link {
    color: #1A2349;
  }
`;

export const Projects = () => (
    <div>
    <Jumbotron_sm className="Projects"></Jumbotron_sm>

    <Nav variant="tabs" defaultActiveKey="link-1" className="justify-content-center" >
        <LinkContainer to="Professional_tab">
        <Nav.Link>Professional Tab</Nav.Link>
    </LinkContainer>
    <LinkContainer to="/rent">
        <Nav.Link>rent</Nav.Link>
    </LinkContainer>
        {/* <Nav.Item>
        <Nav.Link eventKey="link-1">Professional </Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link eventKey="link-2">Personal </Nav.Link>
        </Nav.Item> */}
    </Nav>
  </div>
)
